import React from "react";
import { VariantOutline } from "./VariantOutline";
import { VariantSharp } from "./VariantSharp";
import "./Map.css";

export const Box = () => {
  return (
    <div className="box">
      <div className="map">
        <div className="overlap-group">
          <VariantSharp className="icon-instance-node" />
          <VariantOutline className="icon-instance-node" />
        </div>
      </div>
    </div>
  );
};
